  Tests_13:
    titulo: 16pf
    historia: ''
    enunciado: "Este es un cuestionario de sus actitudes. Lo que hace o lo que piensa acerca de ciertas situaciones. Las personas piensan de una manera u otra. Por lo tanto, no existen respuestas “correctas o incorrectas” a las preguntas de este formulario.Adelante aparecen cinco preguntas de ensayo que contestarán usted para estar seguro de que comprende lo que debe hacer en el propio cuestionario. Marque las contestaciones a estas preguntas de ensayo en la “Hoja de respuestas 16. P.F” en la parte superior izquierda, identificadas con números romanos. Se ofrecen tres posibles respuestas para cada pregunta que Ud. debe contestar “Si o No”, colocando una “Equis (X)” en la casilla (A) si su respuesta es afirmativa; o, en la casilla “C” si es negativa. Solamente debe marcar la respuesta en el centro “B” cuando le sea realmente imposible decir “Si” o “No”.\r\nConteste ahora las cinco siguientes preguntas de ensayo: \r\nI.	Me guata hacer ejercicios al aire libre (A) Si; (B) Más o menos; (C) No.\r\nII.	Me gustaría ser: (A) Operador de máquina de fábrica; (B) Vendedor; (C) Empleado de un Banco.\r\nIII.	Cuando duermo sueño  mucho (A) Si; (B) Ocasionalmente; (C) No.\r\nIV.	Me gusta una persona que sea: (A) Atenta con la gente; (B) Apartad e indiferente con la gente; (C) Que sea sarcástico.\r\nV.	Me es difícil conversar con alguien cuando el radio está puesto. (A) Si; (B) Intermedio; (C) No.\r\nEn las páginas interiores que siguen encontrará 102 preguntas similares a las que apareen arriba. Para contestarlas tenga presente estas reglas:\r\n1.	Conteste las preguntas tan franca y honradamente como le sea posible. No existe ventaja en crear una mejor impresión personal. No marque una respuesta que no sea cierta por creer que “es lo que debe decir”.\r\n2.	Conteste con la mayor rapidez posible. No dedique tiempo en meditar sobre las preguntas. Anote su primera reacción y pase de allí a la próxima pregunta.\r\n3.	Marque la respuesta “Si” (o “A”) o la respuesta “No” (o “C”) con una (X) para la mayoría de las preguntas. Solamente marque las respuestas en el centro “B” cuando le sea imposible contestar “Si” o  “No” aunque en algunos casos le será difícil escoger.\r\n4.	Conteste todas las preguntas sin excepción. Habrá las preguntas que no reflejan sus ideas, pero debe contestarlas todas. No debe saltarse ninguna. Sus respuestas serán confidenciales.   \r\n\r\n5.	onteste las preguntas tan franca y honradamente como le sea posible. No existe ventaja en crear una mejor impresión personal. No marque una respuesta que no sea cierta por creer que “es lo que debe decir”.\r\n6.	Conteste con la mayor rapidez posible. No dedique tiempo en meditar sobre las preguntas. Anote su primera reacción y pase de allí a la próxima pregunta.\r\n7.	Marque la respuesta “Si” (o “A”) o la respuesta “No” (o “C”) con una (X) para la mayoría de las preguntas. Solamente marque las respuestas en el centro “B” cuando le sea imposible contestar “Si” o  “No” aunque en algunos casos le será difícil escoger.\r\n8.	Conteste todas las preguntas sin excepción. Habrá las preguntas que no reflejan sus ideas, pero debe contestarlas todas. No debe saltarse ninguna. Sus respuestas serán confidenciales.   \r\n\r\n\r\n\r\nTodas sus contestaciones en la \"Hoja de Respuestas 16 P.F.\"    No marque ni haga señales en estas hojas.\r\nASEGURESE DE QUE HAYA MARCADO UNA RESPUESTA,  PERO SOLAMENTE UNA, PARA CADA PREGUNTA.\r\n"
